INSERT INTO tblComment (cmmpk, cmmpost, userpk, boardpk) VALUES ((SELECT NVL(MAX(cmmpk), 0) + 1 FROM tblComment), '교통비와 식비에 해당하는 훈련장려금은 단위기간(1개월)동안 출석률이 80%이상이어야 지급됩니다. 교통비는 1일 훈련시간에 상관없이 지원되고 식비는 1일 5시간 이상 훈련과정에 출석한 경우 지급됩니다. 국가기간전략산업직종훈련의 경우 한달 최대 116,000원(20일최대기준)까지 수령이 가능하며, K-디지털트레이닝의 경우 한달 최대 316,000원까지 지원받을 수 있습니다. 따로 신청할 필요 없이 학원 등록시 제출한 통장사본의 계좌로 자동입금됩니다.', 502, 7);
