INSERT INTO tblComment (cmmpk, cmmpost, userpk, boardpk) VALUES ((SELECT NVL(MAX(cmmpk), 0) + 1 FROM tblComment), '취업지원팀이 별도로 구성되어 있어 평가제에 의한 추천 및 지원(취업의지, 자격증 취득, 인성관련, 수업평가)이 이루어지고 있으며, 월 1회 이상 수료자에 대한 전화 상담을 통하여 취업여부 확인 및 미취업자에 대한 계속적인 취업의뢰를 하고 있습니다. 이러한 자료를 토대로 구인업체와 연결하고 있으며 수료 후에도 지속적인 지원이 가능합니다.', 502, 10);
