INSERT INTO tblExamDone (edpk, exanswer, stupk, ocpk, expk) VALUES ((SELECT NVL(MAX(edpk), 0) + 1 FROM tblExamDone),'데이터 웨어하우스와 데이터 레이크 데이터 웨어하우스는 구조화된 데이터의 중앙 집중식 저장소로, 분석을 목적으로 설계되었습니다. 반면 데이터 레이크는 구조화되지 않은 데이터도 포함하여 모든 형태의 데이터를 저장할 수 있는 시스템입니다. 데이터 웨어하우스는 보통 더 엄격한 스키마를 가지며, 데이터 레이크는 스키마가 없거나 스키마 온 리드(schema-on-read) 방식을 사용합니다.',126,6,47);
