INSERT INTO tblExamDone (edpk, exanswer, stupk, ocpk, expk) VALUES ((SELECT NVL(MAX(edpk), 0) + 1 FROM tblExamDone),'분산 컴퓨팅 환경의 주요 문제 분산 컴퓨팅 환경에서는 데이터의 일관성 유지, 시스템의 복원력, 데이터 처리의 신뢰성 및 확장성이 중요한 문제입니다. 또한, 네트워크 지연, 데이터 동기화, 장애 허용(fault tolerance) 및 병목 현상도 주요 고려 사항입니다.',125,6,48);
